  false,\n\t\"url\": null,\n\t\"notes\": \"This document describes a study design
  created to characterize the distribution and abundance of the snowy plover in the
  inland Gulf of Mexico Coast portion of its range. The purpose of this project was
  to derive an index to population size and describe the distribution and conservation
  status of the snowy plovers breeding throughout 1) the interior of the U.S., 2)
  along the Gulf Coast of the U.S. and Mexico, and 3) along the Pacific Coast of Mexico
  during the spring of 2007 and 2008.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
